I am an attorney in Midtown Atlanta, and have been practicing corporate and commercial transactions for nearly a decade. I would like to offer legal services for trade. My expertise is in:

-Entity Formation and Governance
-Complex Corporate and Commercial Transactions; 
-Non-disclosure, Invention Assignment, and Employment Agreements;
-Distribution, Sales/Procurement, and Vendor Agreements; 
-Federal administrative regulations.

Please don't hesitate to ask questions or find out more about my competencies! Call REDACTED or reply to this post.






DISCLAIMER: Please note that an attorney-client relationship, and corresponding confidentiality, does not arise until I have determined that no conflicts of interest exist and have received an executed letter of engagement. Do not send me any confidential information.
